FormScriptItem.Script:
//Parameters: taskId

//Get the logged in user UsID and form DhDocID
var usId = VV.Form.FormUsID;
var formDocId = VV.Form.DhDocID;

return $.ajax({
                url: VV.BaseAppUrl + "/api/v1/" + VV.CustomerAlias + "/" + VV.CustomerDatabaseAlias + "/Users/" + usId + "/workflowtask?taskId=" + taskId + "&formId=" + formDocId,
				cache: false,
				type: "GET",
				dataType: "json"
			}).then(function(resp) {
                var returnObj = {
                    result: false,
                    error: false
                };

                if(resp.meta.status === 200) {
                    returnObj.result = resp.data;
                } else {
                    returnObj.error = true;
                }

                return returnObj;
            });

 var okfunction = function () {
    var $btn = $("[value=Reject3]");
    var taskId = $btn.attr('wfwaid');

    VV.Form.Template.CanUserCompleteWFTask(taskId).then(function (resp) {
        if (!resp.error) {
            if (resp.result) {
                //User can complete task
                VV.Form.SetFieldValue('Status', 'Submitted');
                $btn.trigger('click');
                setTimeout(function () {
                    VV.Form.Global.DisplayMessaging('The task has been completed, and the form is saved when the yellow banner appears above.');
                    VV.Form.DoPostbackSave();
                }, 1000);
            }
            else {
                VV.Form.Global.DisplayMessaging('You are not assigned to complete this workflow task.');
            }
        }
    });
}

var cancelfunction = function () {

}

var messagedata = 'You have indicated that this project issue is still open, and you would like VisualVault to take a second look. Press OK to confirm or Cancel to go back.';
VV.Form.Global.DisplayConfirmMessaging(messagedata, 'Confirm', okfunction, cancelfunction);

